When defining generic types, it is useful to have information about them. Knowing which traits a generic type implements allow us to use them more effectively in a functions logic at the cost of constraining the generic types that can be used with the function. We saw an example of this previously by adding the TDrop implementation as part of the generic arguments of largest_list. While TDrop was added to satisfy the compilers requirements, we can also add constraints to benefit our function logic. Imagine that we want, given a list of elements of some generic type T, find the smallest element among them. Initially, we know that for an element of type T to be comparable, it must implement the PartialOrd trait. The resulting function would be: // This code does not compile!
use array:ArrayTrait; // Given a list of T get the smallest one.
// The PartialOrd trait implements comparison operations for T
fn smallest_element<T, impl TPartialOrd: PartialOrd<T>>(list: @Array<T>) -> T { // This represents the smallest element through the iteration // Notice that we use the desnap (*) operator let mut smallest = *list[0_usize]; // The index we will use to move through the list let mut index = 1_usize; // Iterate through the whole list storing the smallest loop { if index >= list.len(){ break smallest; } if *list[index] < smallest { smallest = *list[index]; } index = index + 1; }
} fn main() { let mut list = ArrayTrait::new(); list.append(5_u8); list.append(3_u8); list.append(10_u8); // We need to specify that we are passing a snapshot of `list` as an argument let s = smallest_element(@list); assert(s == 3_u8, 0); } The smallest_element function uses a generic type T that implements the PartialOrd trait, takes an snapshot of an Array<T> as a parameter and returns a copy of the smallest element. Because the parameter is of type @Array<T>, we no longer need to drop it at the end of the execution and so we don't require to implement the Drop trait for T as well. Why it does not compile then? When indexing on list, the value results in a snap of the indexed element, unless PartialOrd is implemented for @T we need to desnap the element using *. The * operation requires a copy from @T toT, which means that T needs to implement the Copy trait. After copying an element of type @T to T, there are now variables with type T that need to be dropped, requiring for T to implement the Drop trait as well. We must then add both Drop and Copy traits implementation for the function to be correct. After updating thesmallest_element function the resulting code would be: fn smallest_element<T, impl TPartialOrd: PartialOrd<T>, impl TCopy: Copy<T>, impl TDrop: Drop<T>>(list: @Array<T>) -> T { let mut smallest = *list[0_usize]; let mut index = 1_usize; loop { if index >= list.len(){ break smallest; } if *list[index] < smallest { smallest = *list[index]; } index = index + 1; }
}

