We can also define structs to use a generic type parameter for one or more fields using the <> syntax, similar to function definitions. First we declare the name of the type parameter inside the angle brackets just after the name of the struct. Then we use the generic type in the struct definition where we would otherwise specify concrete data types. The next code example shows the definition Wallet<T> which has a balance field of type T. // This code does not compile! #[derive(Drop)]
struct Wallet<T> { balance: T,
} fn main() { let w = Wallet{ balance: 3_u128};
} Compiling the above code would error due to the derive macro not working well with generics. When using generic types is best to directly write the traits you want to use: struct Wallet<T> { balance: T,
} impl WalletDrop<T, impl TDrop : Drop<T>> of Drop<Wallet<t>>; fn main() { let w = Wallet{ balance: 3_u128};
} We avoid using the derive macro for Drop implementation of Wallet and instead define our own WalletDrop implementation. Notice that we must define, just like functions, an additional generic type for WalletDrop saying that T implements the Drop trait as well. We are basically saying that the struct Wallet<T> is droppable as long as T is also droppable. Finally, if we want to add a field to Wallet representing its Cairo address and we want that field to be different than T but generic as well, we can simply add another generic type between the <>: struct Wallet<T, U> { balance: T, address: U,
} impl WalletDrop<T, impl TDrop: Drop<T>, U, impl UDrop: Drop<U>> of Drop<Wallet<T, U>>; fn main() { let w = Wallet{ balance: 3_u128, address: 14};
} We add to Wallet struct definiton a new generic type U and then assign this type to the new field member address. Then we adapt the WalletDrop trait to work with the new generic type U. Notice that when initializing the struct inside main it automatically infers that T is a u128 and U is a felt252 and since they are both droppable, Wallet is droppable as well!

