Usually we want to write a trait when we want multiple types to implement a functionality in a standard way. However, in the example above the signatures are static and cannot be used for multiple types. To do this, we use generic types when defining traits. In the example below, we use generic type T and our method signatures can use this alias which can be provided during implementation. use debug::PrintTrait; // Here T is an alias type which will be provided buring implementation
trait ShapeGeometry<T> { fn boundary( self: T ) -> u64; fn area( self: T ) -> u64;
} // Implementation RectangleGeometry passes in <Rectangle>
// to implement the trait for that type
impl RectangleGeometry of ShapeGeometry::<Rectangle> { fn boundary( self: Rectangle ) -> u64 { 2_u64 * (self.height + self.width) } fn area( self: Rectangle ) -> u64 { self.height * self.width }
} // We might have another struct Circle
// which can use the same trait spec
impl CircleGeometry of ShapeGeometry::<Circle> { fn boundary( self: Circle ) -> u64 { (2_u64 * 314_u64 * self.radius) / 100_u64 } fn area( self: Circle ) -> u64 { (314_u64 * self.radius * self.radius) / 100_u64 }
} fn main() { let rect = Rectangle { height: 5_u128, width: 7_u128 }; rect.area().print(); // 35 rect.boundary().print(); // 24 let circ = Circle { radius: 5_u128 }; circ.area().print(); // 78 circ.boundary().print(); // 31
}

