The assert function, provided by Cairo, is useful when you want to ensure that some condition in a test evaluates to true. We give the assert function a first argument that evaluates to a Boolean. If the value is true, nothing happens and the test passes. If the value is false, the assert function calls panic() to cause the test to fail with a message we defined as the second argument of the assert function. Using the assert function helps us check that our code is functioning in the way we intend. In Chapter 4, Listing 5-15 , we used a Rectangle struct and a can_hold method, which are repeated here in Listing 9-5. Let’s put this code in the src/lib.cairo file, then write some tests for it using the assert function. Filename: lib.cairo trait RectangleTrait { fn area(self: @Rectangle) -> u64; fn can_hold(self: @Rectangle, other: @Rectangle) -> bool;
} impl RectangleImpl of RectangleTrait { fn area(self: @Rectangle) -> u64 { *self.width * *self.height } fn can_hold(self: @Rectangle, other: @Rectangle) -> bool { *self.width > *other.width & *self.height > *other.height }
} Listing 9-5: Using the Rectangle struct and its can_hold method from Chapter 5 The can_hold method returns a Boolean, which means it’s a perfect use case for the assert function. In Listing 9-6, we write a test that exercises the can_hold method by creating a Rectangle instance that has a width of 8_u64 and a height of 7_u64 and asserting that it can hold another Rectangle instance that has a width of 5_u64 and a height of 1_u64. Filename: lib.cairo #[cfg(test)]
mod tests { use super::Rectangle; use super::RectangleTrait; #[test] fn larger_can_hold_smaller() { let larger = Rectangle { height: 7_u64, width: 8_u64, }; let smaller = Rectangle { height: 1_u64, width: 5_u64, }; assert(larger.can_hold(@smaller), 'rectangle cannot hold'); }
} Listing 9-6: A test for can_hold that checks whether a larger rectangle can indeed hold a smaller rectangle Note that we’ve added two new lines inside the tests module: use super::Rectangle; and use super::RectangleTrait;. The tests module is a regular module that follows the usual visibility rules. Because the tests module is an inner module, we need to bring the code under test in the outer module into the scope of the inner module. We’ve named our test larger_can_hold_smaller, and we’ve created the two Rectangle instances that we need. Then we called the assert function and passed it the result of calling larger.can_hold(@smaller). This expression is supposed to return true, so our test should pass. Let’s find out! $ cairo-test .
running 1 tests
test adder::lib::tests::larger_can_hold_smaller ... ok
test result: ok. 1 passed; 0 failed; 0 ignored; 0 filtered out; It does pass! Let’s add another test, this time asserting that a smaller rectangle cannot hold a larger rectangle: Filename: lib.cairo #[cfg(test)]
mod tests { use super::Rectangle; use super::RectangleTrait; #[test] fn larger_can_hold_smaller() { // --snip-- } #[test] fn smaller_cannot_hold_larger() { let larger = Rectangle { height: 7_u64, width: 8_u64, }; let smaller = Rectangle { height: 1_u64, width: 5_u64, }; assert(!smaller.can_hold(@larger), 'rectangle cannot hold'); }
} Because the correct result of the can_hold function in this case is false, we need to negate that result before we pass it to the assert function. As a result, our test will pass if can_hold returns false: $ cairo-test . running 2 tests test adder::lib::tests::smaller_cannot_hold_larger ... ok test adder::lib::tests::larger_can_hold_smaller ... ok test result: ok. 2 passed; 0 failed; 0 ignored; 0 filtered out; Two tests that pass! Now let’s see what happens to our test results when we introduce a bug in our code. We’ll change the implementation of the can_hold method by replacing the greater-than sign with a less-than sign when it compares the widths: // --snip--
impl RectangleImpl of RectangleTrait { fn can_hold(self: @Rectangle, other: @Rectangle) -> bool { *self.width < *other.width & *self.height > *other.height }
} Running the tests now produces the following: $ cairo-test .
running 2 tests
test adder::lib::tests::smaller_cannot_hold_larger ... ok
test adder::lib::tests::larger_can_hold_smaller ... fail
failures: adder::lib::tests::larger_can_hold_smaller - panicked with [167190012635530104759003347567405866263038433127524 ('rectangle cannot hold'), ]. Error: test result: FAILED. 1 passed; 1 failed; 0 ignored Our tests caught the bug! Because larger.width is 8_u64 and smaller.width is 5_u64, the comparison of the widths in can_hold now returns false: 8_u64 is not less than 5_u64.

