In addition to checking return values, it’s important to check that our code handles error conditions as we expect. For example, consider the Guess type in Listing 9-8. Other code that uses Guess depends on the guarantee that Guess instances will contain only values between 1_u64 and 100_u64. We can write a test that ensures that attempting to create a Guess instance with a value outside that range panics. We do this by adding the attribute should_panic to our test function. The test passes if the code inside the function panics; the test fails if the code inside the function doesn’t panic. Listing 9-8 shows a test that checks that the error conditions of GuessTrait::new happen when we expect them to. Filename: lib.cairo use array::ArrayTrait; #[derive(Copy, Drop)]
struct Guess { value: u64,
} trait GuessTrait { fn new(value: u64) -> Guess;
} impl GuessImpl of GuessTrait { fn new(value: u64) -> Guess { if value < 1_u64 { let mut data = ArrayTrait::new(); data.append('Guess must be higher than 1'); panic(data); } else if value > 100_u64 { let mut data = ArrayTrait::new(); data.append('Guess must be smaller than 100'); panic(data); } Guess { value, } }
} #[cfg(test)]
mod tests { use super::Guess; use super::GuessTrait; #[test] #[should_panic] fn greater_than_100() { GuessTrait::new(200_u64); }
} Listing 9-8: Testing that a condition will cause a panic We place the #[should_panic] attribute after the #[test] attribute and before the test function it applies to. Let’s look at the result when this test passes: $ cairo-test .
running 1 tests
test adder::lib::tests::greater_than_100 ... ok
test result: ok. 1 passed; 0 failed; 0 ignored; 0 filtered out; Looks good! Now let’s introduce a bug in our code by removing the condition that the new function will panic if the value is greater than 100_u64: // --snip--
impl GuessImpl of GuessTrait { fn new(value: u64) -> Guess { if value < 1_u64 { let mut data = ArrayTrait::new(); data.append('Guess must be between 1 and 100'); panic(data); } Guess { value, } }
} When we run the test in Listing 9-8, it will fail: $ cairo-test .
running 1 tests
test adder::lib::tests::greater_than_100 ... fail
failures: adder::lib::tests::greater_than_100 - expected panic but finished successfully.
Error: test result: FAILED. 0 passed; 1 failed; 0 ignored We don’t get a very helpful message in this case, but when we look at the test function, we see that it’s annotated with #[should_panic]. The failure we got means that the code in the test function did not cause a panic. Tests that use should_panic can be imprecise. A should_panic test would pass even if the test panics for a different reason from the one we were expecting. To make should_panic tests more precise, we can add an optional expected parameter to the should_panic attribute. The test harness will make sure that the failure message contains the provided text. For example, consider the modified code for Guess in Listing 9-9 where the new function panics with different messages depending on whether the value is too small or too large. Filename: lib.cairo // --snip--
impl GuessImpl of GuessTrait { fn new(value: u64) -> Guess { if value < 1_u64 { let mut data = ArrayTrait::new(); data.append('Guess must be greater than 1'); panic(data); } else if value > 100_u64 { let mut data = ArrayTrait::new(); data.append('Guess must be lower than 100'); panic(data); } Guess { value, } }
} #[cfg(test)]
mod tests { use super::Guess; use super::GuessTrait; #[test] #[should_panic(expected: ('Guess must be lower than 100', ))] fn greater_than_100() { GuessTrait::new(200_u64); }
} Listing 9-9: Testing for a panic with a panic message containing the error message string This test will pass because the value we put in the should_panic attribute’s expected parameter is the string of the message that the Guess::new function panics with. We need to specify the entire panic message that we expect. To see what happens when a should_panic test with an expected message fails, let’s again introduce a bug into our code by swapping the bodies of the if value < 1_u64 and the else if value > 100_u64 blocks: if value < 1_u64 { let mut data = ArrayTrait::new(); data.append('Guess must be lower than 100'); panic(data);
} else if value > 100_u64 { let mut data = ArrayTrait::new(); data.append('Guess must be greater than 1'); panic(data);
} This time when we run the should_panic test, it will fail: $ cairo-test .
running 1 tests
test adder::lib::tests::greater_than_100 ... fail
failures: adder::lib::tests::greater_than_100 - panicked with [7525466742201272999442800965907272684056773373474020086884212809777 ('Guess must be greater than 1'), ]. Error: test result: FAILED. 0 passed; 1 failed; 0 ignored The failure message indicates that this test did indeed panic as we expected, but the panic message did not include the expected string. The panic message that we did get in this case was Guess must be greater than 1. Now we can start figuring out where our bug is!

