The #[cfg(test)] annotation on the tests module tells Cairo to compile and run the test code only when you run cairo-test, not when you run cairo-run. This saves compile time when you only want to build the library and saves space in the resulting compiled artifact because the tests are not included. You’ll see that because integration tests go in a different directory, they don’t need the #[cfg(test)] annotation. However, because unit tests go in the same files as the code, you’ll use #[cfg(test)] to specify that they shouldn’t be included in the compiled result. Recall that when we created the new adder project in the first section of this chapter, we wrote this first test: Filename: lib.cairo #[cfg(test)]
mod tests { #[test] fn it_works() { let result = 2 + 2; assert(result == 4, 'result is not 4'); }
} The attribute cfg stands for configuration and tells Cairo that the following item should only be included given a certain configuration option. In this case, the configuration option is test, which is provided by Cairo for compiling and running tests. By using the cfg attribute, Cairo compiles our test code only if we actively run the tests with cairo-test. This includes any helper functions that might be within this module, in addition to the functions annotated with #[test].

