Vamos a crear un nuevo proyecto utilizando Scarb y ver en qué se diferencia de nuestro proyecto original “Hello, world!”. Navegue de nuevo a su directorio de proyectos (o donde haya decidido almacenar su código). Luego ejecute lo siguiente: $ scarb new hello_scarb Crea un nuevo directorio y proyecto llamado hello_scarb. Hemos llamado a nuestro proyecto hello_scarb, y Scarb crea sus archivos en un directorio con el mismo nombre. Entre en el directorio hello_scarb con el comando cd hello_scarb.Verás que Scarb ha generado dos archivos y un directorio para nosotros: un archivo Scarb.toml y un directorio src con un archivo lib.cairo dentro. También ha inicializado un nuevo repositorio Git junto con un archivo .gitignore. Nota: Git es un sistema de control de versiones común. Puede dejar de usar el sistema de control de versiones usando la bandera --vcs. Ejecute scarb new -help para ver las opciones disponibles. Abra Scarb.toml en su editor de texto preferido. Debería parecerse al código del Listado 1-2. Filename: Scarb.toml [package]
name = "hello_scarb"
version = "0.1.0" # Vea más claves y sus definiciones en https://docs.swmansion.com/scarb/docs/reference/manifest [dependencies]
# foo = { path = "vendor/foo" } Listing 1-2: Contents of Scarb.toml generated by scarb new Este archivo se encuentra en formato TOML (Tom’s Obvious, Minimal Language), que es el formato de configuración de Scarb. La primera línea, [package], es un encabezado de sección que indica que las siguientes sentencias están configurando un paquete. A medida que agreguemos más información a este archivo, agregaremos otras secciones. Las siguientes dos líneas establecen la información de configuración que Scarb necesita para compilar su programa: el nombre y la versión de Scarb a utilizar. La última línea, [dependencies], es el comienzo de una sección para que puedas listar cualquiera de las dependencias de tu proyecto. En Cairo, los paquetes de código se conocen como crates. No necesitaremos ninguna otra crate para este proyecto. El otro archivo creado por Scarb es src/lib.cairo, borremos todo el contenido y pongamos el siguiente contenido, explicaremos la razón más adelante. mod hello_scarb; A continuación, cree un nuevo archivo llamado src/hello_scarb.cairo y ponle el siguiente código: Filename: src/hello_scarb.cairo use debug::PrintTrait;
fn main() { 'Hello, Scarb!'.print();
