La sombra de una variable se refiere a la declaración de una nueva variable con el mismo nombre que una variable anterior. Los caironautas dicen que la primera variable está sombreada por la segunda, lo que significa que el compilador verá la segunda variable cuando use el nombre de la variable. En efecto, la segunda variable oculta la primera, tomando cualquier uso del nombre de la variable para sí misma hasta que ella misma sea sombreada o que el ámbito termine. Podemos sombrear una variable usando el mismo nombre de la variable y repitiendo el uso de la palabra clave let de la siguiente manera: Filename: src/lib.cairo use debug::PrintTrait;
fn main() { let x = 5; let x = x + 1; { let x = x * 2; 'Inner scope x value is:'.print(); x.print() } 'Outer scope x value is:'.print(); x.print();
} Este programa primero asigna un valor de 5 a x. Luego crea una nueva variable x repitiendo let x =, tomando el valor original y sumando 1, por lo que el valor de x es ahora 6. Luego, dentro de un ámbito interno creado con llaves, la tercera instrucción let también sombrea x y crea una nueva variable, multiplicando el valor anterior por 2 para darle a x un valor de 12. Cuando ese ámbito termina, la sombra interna termina y x vuelve a ser 6. Al ejecutar este programa, se mostrará lo siguiente: cairo-run src/lib.cairo
[DEBUG]	Inner scope x value is: (raw: 7033328135641142205392067879065573688897582790068499258) [DEBUG] (raw: 12) [DEBUG]	Outer scope x value is: (raw: 7610641743409771490723378239576163509623951327599620922) [DEBUG] (raw: 6) Run completed successfully, returning [] El sombreado es diferente de marcar una variable como mut, porque obtendremos un error en tiempo de compilación si intentamos reasignar a esta variable sin usar la palabra clave let. Al usar let, podemos realizar algunas transformaciones en un valor pero hacer que la variable sea inmutable después de que se hayan completado esas transformaciones. Otra diferencia entre mut y el sombreado es que al usar la palabra clave let nuevamente, estamos creando efectivamente una nueva variable, lo que nos permite cambiar el tipo del valor mientras reutilizamos el mismo nombre. Como se mencionó antes, el sombreado de variables y las variables mutables son equivalentes a un nivel más bajo. La única diferencia es que al sombrear una variable, el compilador no se quejará si cambia su tipo. Por ejemplo, digamos que nuestro programa realiza una conversión de tipo entre los tipos u64 y felt252. use debug::PrintTrait;
use traits::Into;
fn main() { let x = 2_u64; x.print(); let x = x.into(); // converts x to a felt. x.print()
} LEl primer variable x tiene un tipo u64, mientras que la segunda variable x tiene un tipo felt252. Por lo tanto, el shadowing nos ahorra tener que inventar diferentes nombres, como x_u64 y x_felt252; en su lugar, podemos reutilizar el nombre más simple x. Sin embargo, si intentamos usar mut para esto, como se muestra aquí, obtendremos un error en tiempo de compilación: use debug::PrintTrait;
use traits::Into;
fn main() { let mut x = 2_u64; x.print(); x = x.into(); x.print()
} El error dice que se esperaba un u64 (el tipo original) pero se obtuvo un tipo diferente: ❯ cairo-run src/lib.cairo
error: Unexpected argument type. Expected: "core::integer::u64", found: "core::felt252". --> lib.cairo:6:9 x = x.into(); ^******^ Error: failed to compile: src/lib.cairo Ahora que hemos explorado cómo funcionan las variables, veamos otros tipos de datos que pueden tener.

