Un tipo scalar representa un único valor. Cairo tiene tres tipos escalares primarios: fieltros, enteros y booleanos. Puede que reconozca de otros lenguajes de programación. Veamos cómo funcionan en Cairo. Tipo Felt En Cairo, si no especificas el tipo de una variable o argumento, su tipo por defecto es un elemento de campo, representado por la palabra clave felt252. En el contexto de Cairo, cuando decimos "un elemento de campo" nos referimos a un entero en el rango 0 <= x < P, donde P es un número primo muy grande actualmente igual a P = 2^{251} + 17 * 2^{192}+1. Al sumar, restar o multiplicar, si el resultado queda fuera del rango especificado del número primo, se produce un desbordamiento y se suma o resta un múltiplo apropiado de P para que el resultado vuelva a estar dentro del rango (es decir, el resultado se calcula módulo P). La diferencia más importante entre los números enteros y los elementos de campo es la división: La división de elementos de campo (y, por tanto, la división en Cairo) es distinta de la división normal de las CPU, en la que la división entera x / y se define como [x/y] donde se devuelve la parte entera del cociente (por lo que se obtiene 7 / 3 = 2) y puede o no satisfacer la ecuación (x / y) * y == x, dependiendo de la divisibilidad de x por y. En Cairo, el resultado de x/y está definido para satisfacer siempre la ecuación (x / y) * y == x. Si y divide a x entre enteros, obtendrás el resultado esperado en Cairo (por ejemplo 6 / 2 dará como resultado 3). Pero cuando y no divide a x, puedes obtener un resultado sorprendente: Por ejemplo, como 2 * ((P+1)/2) = P+1 ≡ 1 mod[P], el valor de 1 / 2 en Cairo es (P+1)/2 (y no 0 ó 0,5), ya que satisface la ecuación anterior. Tipos enteros El tipo felt252 es un tipo fundamental que sirve como base para la creación de todos los tipos en la librería central. Sin embargo, se recomienda encarecidamente a los programadores que utilicen los tipos enteros en lugar del tipo felt252 siempre que sea posible, ya que los tipos integer vienen con características de seguridad añadidas que proporcionan protección extra contra posibles vulnerabilidades en el código, como comprobaciones de desbordamiento. Utilizando estos tipos de enteros, los programadores pueden asegurarse de que sus programas son más seguros y menos susceptibles a ataques u otras amenazas de seguridad. Un integer es un número sin componente fraccionario. Esta declaración de tipo indica el número de bits que el programador puede utilizar para almacenar el entero. La Tabla 3-1 muestra los tipos enteros incorporados en Cairo. Podemos usar cualquiera de estas variantes para declarar el tipo de un valor entero. Table 3-1: Integer Types in Cairo Length Unsigned 8-bit u8 16-bit u16 32-bit u32 64-bit u64 128-bit u128 256-bit u256 32-bit usize Cada variante tiene un tamaño explícito. Tenga en cuenta que por ahora, el tipo usize es sólo un alias para u32; sin embargo, podría ser útil cuando en el futuro Cairo pueda ser compilado a MLIR. Como las variables son sin signo, no pueden contener un número negativo. Este código hará que el programa entre en pánico: fn sub_u8s(x: u8, y: u8) -> u8 { x - y
} fn main() { sub_u8s(1,3);
} Puede escribir literales enteros en cualquiera de las formas mostradas en la Tabla 3-2. Observe que los literales numéricos que pueden ser múltiples tipos numéricos permiten un sufijo de tipo como 57_u8, para designar el tipo. Table 3-2: Integer Literals in Cairo Numeric literals Example Decimal 98222 Hex 0xff Octal 0o04321 Binary 0b01 Entonces, ¿cómo saber qué tipo de entero utilizar? Intenta estimar el valor máximo que puede tener tu int y elige un buen tamaño. La principal situación en la que usarías usize es al indexar algún tipo de colección. Operaciones numéricas Cairo soporta las operaciones matemáticas básicas que esperarías para todos los tipos de enteros: suma, resta, multiplicación y resto (u256 no soporta división y resto todavía). Entero trunca hacia cero al entero más cercano. El siguiente código muestra cómo utilizar cada operación numérica en una sentencia let: fn main() { // addition let sum = 5_u128 + 10_u128; // subtraction let difference = 95_u128 - 4_u128; // multiplication let product = 4_u128 * 30_u128; // division let quotient = 56_u128 / 32_u128; //result is 1 let quotient = 64_u128 / 32_u128; //result is 2 // remainder let remainder = 43_u128 % 5_u128; // result is 3
} Cada expresión de estas sentencias utiliza un operador matemático y se evalúa a un único valor, que se asigna a una variable. El tipo Booleano Como en la mayoría de los lenguajes de programación, un tipo booleano en Cairo tiene dos posibles valores: true y false. Los booleanos tienen un byte de tamaño. El tipo booleano en Cairo se especifica usando bool. Por ejemplo: fn main() { let t = true; let f: bool = false; // with explicit type annotation
} La principal forma de utilizar valores booleanos es a través de condicionales, como una expresión if expresión. Cubriremos cómo funcionan las expresiones if en Cairo en la sección. “Control de flujo” El tipo de Short String Cairo no tiene un tipo nativo para strings, pero puedes almacenar caracteres formando lo que llamamos un "short string" dentro de felt252. Aquí hay algunos ejemplos de declaración de valores entre comillas simples: let my_first_char = 'C';
