Los tipos compuestos pueden agrupar varios valores en un tipo. Cairo tiene dos tipos compuestos primitivos: Tuplas y Matrices. El tipo tupla Una tupla es una forma general de agrupar un número de valores con una variedad de tipos en un tipo compuesto. Las tuplas tienen una longitud fija: una vez declaradas, no pueden aumentar ni disminuir de tamaño. Se crea una tupla escribiendo una lista de valores separados por comas entre paréntesis. Cada posición de la tupla tiene un tipo, y los tipos de los distintos valores de la tupla no tienen por qué ser iguales. Hemos añadido anotaciones opcionales de tipo en este ejemplo: fn main() { let tup: (u32,u64,bool) = (10,20,true);
} La variable tup se vincula a toda la tupla porque una tupla se considera un único elemento compuesto. Para obtener los valores individuales de una tupla, podemos utilizar la concordancia de patrones para desestructurar un valor de tupla, así: use debug::PrintTrait;
fn main() { let tup = (500, 6, true); let (x, y, z) = tup; if y == 6 { 'y is six!'.print(); }
} Este programa crea primero una tupla y la asocia a la variable tup. A continuación, utiliza un patrón con let para tomar tup y convertirla en tres variables separadas, x, y, y z. Esto se llama desestructuración porque divide la tupla en tres partes. Finalmente, el programa imprime y es seis ya que el valor de y es 6. También podemos declarar la tupla con valor y nombre al mismo tiempo. Por ejemplo: fn main() { let tup: (x: felt, y: felt) = (2,3);
} El tipo Array Otra forma de tener una colección de múltiples valores es con un array . A diferencia de cada elemento de un array debe tener el mismo tipo. Puedes crear y utilizar métodos de array importando el trait array::ArrayTrait. Una cosa importante a tener en cuenta es que los arrays son append-only. Esto significa que sólo puedes añadir elementos al final de un array. Los arrays son, de hecho, colas cuyos valores no se pueden saltar ni modificar. Esto tiene que ver con el hecho de que una vez que se escribe en un espacio de memoria, no se puede sobrescribir, sino sólo leer de él. He aquí un ejemplo de creación de un array con 3 elementos: use array::ArrayTrait; fn main() { let mut a = ArrayTrait::new(); a.append(0); a.append(1); a.append(2);
} Es posible eliminar un elemento de la parte frontal de un array llamando al método pop_front(): use option::OptionTrait;
use array::ArrayTrait;
use debug::PrintTrait; fn main() { let mut a = ArrayTrait::new(); a.append(10); a.append(1); a.append(2); let first_value = a.pop_front().unwrap(); first_value.print(); } El código anterior imprimirá 10 cuando eliminemos el primer elemento añadido. Puedes pasar el tipo esperado de elementos dentro del array al instanciar el array así let mut arr = ArrayTrait::<u128>::new(); Acceso a los elementos de una matriz Para acceder a los elementos de un array, puedes utilizar los métodos get() o at() que devuelven diferentes tipos. Utilizar arr.at(index) es equivalente a utilizar el operador de subíndice arr[index]. La función get devuelve una Option<Box<@T>>, lo que significa que devuelve una opción a un tipo Box (el tipo smart-pointer de Cairo) que contiene una instantánea al elemento en el índice especificado si ese elemento existe en el array. Si el elemento no existe, get devuelve None. Este método es útil cuando esperas acceder a índices que pueden no estar dentro de los límites del array y quieres manejar tales casos con gracia sin pánicos. Las instantáneas se explicarán con más detalle en el capítulo Referencias y Snapshots . La función at, por otro lado, devuelve directamente una instantánea al elemento en el índice especificado utilizando el operador unbox() para extraer el valor almacenado en una caja. Si el índice está fuera de los límites, se produce un error de pánico. Sólo debe utilizar at cuando desee que el programa entre en pánico si el índice proporcionado está fuera de los límites del array, lo que puede evitar comportamientos inesperados. En resumen, usa at cuando quieras que el programa entre en pánico ante intentos de acceso fuera de los límites, y usa get cuando prefieras manejar estos casos con gracia sin entrar en pánico. fn main() { let mut a = ArrayTrait::new(); a.append(0); a.append(1); let first = *a.at(0_usize); let second = *a.at(1_usize);
} En este ejemplo, la variable llamada first obtendrá el valor 0 porque es el valor del índice 0 del array. La variable llamada second obtendrá el valor 1 del índice 1 del array. use array::ArrayTrait;
use box::BoxTrait;
fn main() -> u128 { let mut arr = ArrayTrait::<u128>::new(); arr.append(100_u128); let length = arr.len(); match arr.get(length - 1_usize) { Option::Some(x) => { *x.unbox() }, Option::None(_) => { let mut data = ArrayTrait::new(); data.append('out of bounds'); panic(data) } } // returns 100
} El ejemplo anterior muestra cómo podemos hacer una gestión de errores utilizando el método get en lugar del método at.

